var routesStyle = {
	color: "#FF0000",
	opacity: 1,
	weight: 5,
}

var nychaStyle = {
	color: "#D9D3C4",
	fillColor: "#D9D3C4",
	fillOpacity: .5,
	opacity: 0,
	weight: 2
};

var connectorStyle = {
	color: "#FF7F00",
	opacity: 1,
	weight: 10,
	dashArray: "1,15",
	lineCap: "square"
};

var schoolsStyle = {
	color: "#FF0000",
	fillColor: "#A3BAD2",
	fillOpacity: 0.75,
	opacity: 1,
	weight: 0
};

L.geoJson(schools, {
	style: schoolsStyle,
	onEachFeature: function (feature, layer){
		if (feature.properties.NAME != null){
			layer.bindPopup(feature.properties.NAME);
		}
		else {
		}
	}
}).addTo(map);

L.geoJson(nycha, {
	style: nychaStyle,
	onEachFeature: function (feature, layer){
		if (feature.properties.NAME != null){
			layer.bindPopup(feature.properties.NAME);
		}
		else{
		}
	}
}).addTo(map);

L.geoJson(routes, {
	style: function(feature){
		switch (feature.properties.VALUE){
			case 1: return {
				color: "#00DBFF",
				opacity: 1,
				weight: 3
			};
			case 0: return {
				color: "#FF0000",
				opacity: 1,
				weight: 3
			};
		}
	},
	onEachFeature: function (feature, layer){
		if(feature.properties.NOTES != null){
			layer.bindPopup(feature.properties.NOTES)
		}
		else{}
	}
}).addTo(map);

L.geoJson(comments, {
	style: function(feature){
		switch (feature.properties.VALUE){
			case 1: return {
				fillColor: "#00DBFF",
				color: "#00DBFF",
				opacity: 1,
				fillOpacity: 0.5,
				radius: 10,
				weight: 1
			};
			case -1: return {
				fillColor: "#FF0000",
				color: "#FF0000",
				opacity: 1,
				fillOpacity: 0.5,
				radius: 10,
				weight: 1
			};
			default: return {
				fillColor: "#999999",
				color: "#999999",
				radius: 6,
				opacity: 1,
				weight: 1,
				fillOpacity: 1
			};
		}
	},
    pointToLayer: function(feature, latlng) {
        return L.circleMarker(latlng, {
        });
    }
}).addTo(map);

L.geoJson(comments, {
	style: function(feature){
		switch (feature.properties.VALUE){
			case 1: return {
				fillColor: "#00DBFF",
				color: "#00DBFF",
				opacity: 1,
				fillOpacity: 0.35,
				radius: 6,
				weight: 1
			};
			case -1: return {
				fillColor: "#FF0000",
				color: "#FF0000",
				opacity: 1,
				fillOpacity: 0.35,
				radius: 6,
				weight: 1
			};
			default: return {
				fillColor: "#999999",
				color: "#999999",
				radius: 6,
				opacity: 1,
				weight: 1,
				fillOpacity: 1
			};
		}
	},
    pointToLayer: function(feature, latlng) {
        return L.circleMarker(latlng, {
        });
    },
    onEachFeature: function (feature, layer) {
    	if(feature.properties.URL2 != null){
    	    layer.bindPopup(feature.properties.NOTES + "<br /><br /><img src="+feature.properties.URL2+" width=200>");
    	}
    	else{
    	    layer.bindPopup(feature.properties.NOTES);
    	}
    }
}).addTo(map);

L.geoJson(connector, {
	style: connectorStyle,
	onEachFeature: function(feature, layer){
		layer.bindPopup("Randall's Island Connector<br /><br />"+"<img src=https://dl.dropboxusercontent.com/u/7595728/NYRP_Community_Map_Photos/JPEG/Randall%27s%20Island%20Connector%20entrance.jpg width=200>")
	}
}).addTo(map);



var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info'); // create a div with a class "info"
    this.update();
    return this._div;
};

var legend = L.control({position: 'topleft'});

legend.onAdd = function (map) {

    var div = L.DomUtil.create('div', 'info legend');
    div.innerHTML += '<h2>COMMUNITY MEETING OUTCOME MAP</h2><br>';
    div.innerHTML += 'BASED ON INPUT BY COMMUNITY MEMBERS<br>';
	div.innerHTML += '<i class="circle" style="background:#00DBFF"></i>'+'NEIGHBORHOOD ASSESTS<br>';
	div.innerHTML += '<i class="circle" style="background:#FF0000"></i>'+'NEGATIVE OR PROBLEMATIC LOCATIONS<br>';
	div.innerHTML += '<i class="circle2" style="background:#999999"></i>'+'OTHER COMMENTS<br>';
	div.innerHTML += '<i class="line" style="background:#00DBFF"></i>'+'POSITIVE ROUTES TO/FROM RANDALLS ISLAND<br>';
	div.innerHTML += '<i class="line" style="background:#FF0000"></i>'+'BARRIERS OR DANGEROUS ROUTES<br>';
	div.innerHTML += '<p>MAP CREATED BY THE <a href="http://spatialinformationdesignlab.org">SPATIAL INFORMATION DESIGN LAB</a><p>';

    return div;
};

legend.addTo(map);